import styled from "styled-components";
import React from "react";
import ReactDOM from "react-dom";

function Foods(props) {
  const { data } = props;
  return (
    <div>
      {data.map((items) => (
        <img src={items.img} />
      ))}
    </div>
  );
}

export default Foods;
